(1528, 2, 'info', 'cookie_usage', 'Nous avons détecté que votre navigateur ne prend pas en charge les fichiers témoins ou les fichiers témoins sont désactivé.<br /><br />Pour continuer de magasiner en ligne, nous vous recommandons d''activer les fichiers témoins dans votre navigateur.<br /><br />Pour le navigateur <b>Internet Explorer</b>, veuillez suivre ces instructions:<br /><ol><li>Ouvrez le menu Outils, sélectionner Options Internet </li><li>Choisir l''onglet Sécurity et établissez le niveau de sécurité à Moyen</li></ol>Nous avons pris cette mesure de sécurité dans votre avantage et nous regrettons si des inconvénients sont causés.<br /><br />Please contact the store owner if you have any questions relating to this requirement, or to continue purchasing products offline.'),
(1529, 2, 'info', 'ssl_check', 'Nous avons détecté que votre navigateur a généré une session sécurisé SSL différente de celle de notre serveur sécurisé.<br /><br />Pour des raisons de sécurité, vous devrez connecter à votre compte de nouveau pour continuer votre magasinage en ligne.<br /><br />Certains navigateur moins récents n''ont pas la capacité de généré une session sécurisé SSL automatiquement tel que requis. Si vous utilisez un navigateur de la sorte, nous vous recommandons d''installer un autre navigateur tel que <a href="http://www.microsoft.com/ie/" target="_blank">Microsoft Internet Explorer</a>, <a href="http://www.mozilla.com/firefox/" target="_blank">Firefox</a>, ou <a href="http://www.opera.com" target="_blank">Opera</a> pour continuer votre expérience de magasinage en ligne.<br /><br />Nous avons pris ces mesures de sécurité à votre avantage et regrettons si des inconvénients sont causés.<br /><br />Veuillez contacter le responsable de la boutique si vous avez des questions relatives à cette exigence ou pour continuer de magasinez hors ligne.'),
