(1650, 2, 'search', 'search_help', 'Les mots-clés peuvent être séparés par les arguments AND et/ou OR pour des résultats plus précis.<br /><br />Par exemple, <u>Microsoft AND souris</u> génèrera des résultats contenant les deux mots. Cependant, pour <u>souris OR clavier</u>, les résultats contiendront les deux mots ou seulement l''un d''entre-eux.<br /><br />Un groupe de mot précis peuvent être obtenus en renfermant les mots-clés entre des guillements.<br /><br />Par exemple, <u>"ordinateur portable"</u> génèrera des résultats répondant exactement à la chaîne demandée.<br /><br />Des parenthèses peuvent également être utilisées pour plus de contrôle sur les résultats.<br /><br />Par exemple, <u>Microsoft AND (clavier OR souris OR "visual basic")</u>.'),
